import React from 'react'
import PropTypes from 'prop-types'
import { useForm } from "react-hook-form";
function EmployeeForm(props) {
    const {title} = props
    const { register, handleSubmit } = useForm()
    const onSubmit = data => console.log(data);
    return (
    <div className="mx-5 my-8">
        <div className="text-lg font-medium">{title}</div>
        <form onSubmit={handleSubmit(onSubmit)}>
        <div className="grid-cols-2 grid">
            <div className="grid grid-cols-6">
                
            </div>
        </div>
        <div>
            <button type="submit" className="mr-2 text-white font-medium w-36 h-10 bg-violet-500 rounded-full hover:bg-violet-600">Save</button>
            <button type="cancel" className="mr-2 text-gray-500  w-36 h-10 font-medium bg-gray-200 rounded-full hover:bg-gray-300">Cancel</button>
        </div>
        </form>
    </div>
  )
}

EmployeeForm.propTypes = {
    title: PropTypes.string,
    employee: PropTypes.object.isRequired,
}
EmployeeForm.defaultProps = {
    title: 'Add New Employee',
}

export default EmployeeForm
